import React, { useState } from 'react';
import './App.css';
import Main from './pages/Main/Main';
enum Page{
  None,First,Second,Third,Fourth
}
function App() {
  let [page,set_page] = useState(Page.First)
  let actions: (()=>void)[] = [
    ()=>{
      set_page(Page.First)
      console.log("First button has been clicked "+page)
    },
    ()=>{
      set_page(Page.Second)
      console.log("Second button has been clicked "+page)
    },
    ()=>{
      set_page(Page.Third)
      console.log("Third button has been clicked "+page)
    },()=>{
      set_page(Page.Fourth)
      console.log("Forth button has been clicked "+page)
  }]

  return (
    <div className="App">
      {page == Page.None? <Main  boton_actions={actions}></Main>:null}
    </div>
  );
}

export default App;
